import React, { useState } from 'react';
import { Button,Modal,Form, Row, Col } from 'react-bootstrap';
const PopRequest = (props) => {
    const [show, setShow] = useState(false)
    const handleClose = () =>setShow(false)
    const handleShow = () =>setShow(true)
    const data=props.data
    console.log(data)
    return (
        <div>
            <Button variant="info" onClick={handleShow}>
        Check this request
      </Button>
      <Row>
        <Col>

      <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false} dialogClassName="modal-xl">
        <Modal.Header closeButton>
    <Modal.Title>{data.requestOrigin}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form className="myForm"> 
          Requested vaccine:
    {/* {Object.entries(data.request).map((key,value)=> <p>{key}</p>)} */}
    {Object.entries(data.request).map(e=><p>{`${e[0]} Amount needed`} <b>{e[1]}</b></p>)}

      </Form>
          </Modal.Body>
        <Modal.Footer>
          <Button variant="primary" onClick={handleClose}>
            Select
          </Button>
        </Modal.Footer>
      </Modal>
      </Col>
      </Row>
        </div>

     );
}

export default PopRequest;
